import React from 'react';


function Header() {
  return (
    <div className="Header">
        <div className="avatar"><a href="/"><img className='' src={require("../img/victorya.jpg")} alt="Victorya Plesser" /></a></div>
        <div className="name">Виктория Плессер</div>
        <div className="position">Клинический психолог, супервизор, RMDR-терапевт, 
          эмоционально-фокусированный терапевт
        </div>
    </div>
  );
}

export default Header;
